/* Styles inlined from /earth-engine/css/base.css */
.ee-schema-metadata {
  display: none;
}

.ee-tag-buttons a.ee-chip {
  background-color: #f1f2f5;
  border-radius: 8px;
  -webkit-border-radius: 8px;
  -moz-border-radius: 8px;
  color: #5f6368;
  display: inline-block;
  font-weight: 100;
  font-size: 10pt;
  margin: 4px 2px;
  padding: 5px 11px;
  text-transform: lowercase;

}

a.open-in-ee .material-icons {
  color: #212121;
  font-size: 14pt;
  vertical-align: middle;
}

a.open-in-ee .material-icons:hover {
  color: #1b69d2;
}

.ee-tag-buttons a.ee-chip:hover {
  background: #e7f0fe;
  color: #1b69d2;
  text-transform: lowercase;
}

.ee-tag-buttons .ee-small {
  text-align: center;
}

.ee-sample-image figure {
  text-align: center;
}

/* controls icon used next to image collection buttons */
.ee-tag-buttons span.material-icons {
  display: inline-block;
  font-size: 17px;
  margin-right: 4px;
}

.ee-datasets-grid ul {
  display: grid;
  display: -ms-grid;
  grid-gap: 5px;
  grid-template-columns: repeat(auto-fill, minmax(256px, 1fr));
  -ms-grid-columns: repeat(auto-fill, minmax(256px, 1fr));
  list-style-type: none;
  margin: 0 auto 20px;
}

.ee-datasets-grid.ee-tags ul {
  grid-template-columns: repeat(auto-fill, minmax(200px, 1fr));
  -ms-grid-columns: repeat(auto-fill, minmax(200px, 1fr));
}

.ee-datasets-grid ul.list tr,
.ee-datasets-grid ul.list td {
  background: transparent !important;
}

.ee-datasets-grid .ee-dataset-description-snippet {
  height: 150px;
  overflow: hidden;
}

.ee-datasets-grid ul.list h3 {
  font-size: 13pt;
  height: 80px;
  line-height: 18pt;
  margin-top: 8px;
  margin-bottom: 8px;
  overflow: hidden;
}
.ee-datasets-grid.ee-tags .list h3 {
  height: 24px;
}

.ee-datasets-grid .ee-tag-header {
  height: auto;
}

.ee-datasets-grid ul.list {
  padding-left: 0px;
}

.material-icons.tabs {
  vertical-align: middle;
}

.ee-datasets-grid .ee-sample-image img {
  height: 256px;
  max-width: 100%;
}

@media only screen and (max-width:750px) {
  .ee-datasets-grid .ee-sample-image img {
    display: none;
  }
}

.ee-signup-modal-dialog {
  left: 50%;
  margin-left: -274px;
  top: 25%;
  width: 548px;
}

.ee-tag-quantity {
  color: #9e9e9e;
  font-size: 10pt;
  line-height: 8pt;
}

.ee-full-bleed {
  margin: 0 calc(50% - 50vw);
  max-width: inherit;
}

.ee-full-bleed:first-child div {
  padding: 0px;
}

.ee-container {
  display: flex;
  flex-wrap: wrap;
}

div.ee-thumbnail {
  height: 100%;
  vertical-align: middle;
}

img.ee-thumbnail {
  min-width: 256px;
  margin-right: 20px;
}

.ee-container dl {
  max-width: 700px;
  display: block;
}

.ee-logo-container img {
  height: 51px;
}

.landing-dataset .material-icons {
  color: #4285f4;
}

.landing-compute .material-icons {
  color: #ea4335;
}

.landing-apis .material-icons {
  color: #fbbc04;
}

.landing-apps .material-icons {
  color: #34a853;
